import React, {useState, useEffect} from 'react';
import axios from 'axios';

export default function Memberlist() {
    const [user, setuser] = useState([]);
    useEffect(() => {
        axios.get("http://localhost:5000/users/")
        .then(response=>{
            setuser(response.data);
        })
        .catch(error=>
            {console.log(error)
            });
    })
    return (
        <div>
            <h1>Member List</h1>
            {(user.map(users=>{
                return (
                    <div>
                        <table>
                            <thead>
                                <tr>
                                <th>First Name</th>
                                <th>Last Name</th>
                                <th>Email</th>
                                <th>Contact</th>
                                </tr>
                            </thead>
                            <tbody>
                            <tr key={users._id}>
                                <td>{JSON.stringify(users.firstname) }</td>
                                <td>{JSON.stringify(users.lastname) }</td>
                                <td>{JSON.stringify(users.email) }</td>
                                <td>{JSON.stringify(users.contact) }</td>
                            </tr>
                            </tbody>
                        </table>

                    </div>
                )
            }

            ))}

        </div>
    )
}
